import{_ as t,c as e,o as a,a as p}from"./app.7d0f4333.js";const S=JSON.parse('{"title":"getting Start","description":"","frontmatter":{},"headers":[],"relativePath":"gettingStart.md"}'),r={name:"gettingStart.md"},n=p('<h1 id="getting-start" tabindex="-1">getting Start <a class="header-anchor" href="#getting-start" aria-hidden="true">#</a></h1><p>\u771F\u6B63\u7684\u6559\u80B2\u4E2D\uFF0C\u4E25\u683C\u8981\u6C42\u662F\u5BF9\u5B66\u751F\u6700\u9AD8\u7684\u5C0A\u91CD\uFF0C\u662F\u771F\u6B63\u4E3A\u5B66\u751F\u8D1F\u8D23\u4EFB</p><p>\u6700\u8FD1\uFF0C\u4E24\u540D\u7F8E\u56FD\u5316\u5B66\u5BB6\u83B7\u5F972022\u5E74\u8BFA\u8D1D\u5C14\u5316\u5B66\u5956\u7684\u6D88\u606F\u5E7F\u53D7\u5173\u6CE8\uFF0C\u800C\u4E00\u4F4D\u7EBD\u7EA6\u5927\u5B66\u5316\u5B66\u6559\u6388\u88AB\u89E3\u96C7\u7684\u6D88\u606F\u4E5F\u5728\u793E\u4EA4\u5A92\u4F53\u4E0A\u4E0D\u80EB\u800C\u8D70\uFF0C84\u5C81\u7684\u77E5\u540D\u6709\u673A\u5316\u5B66\u6559\u6388\u5C0F\u6885\u7279\u5170\xB7\u743C\u65AF\u88AB\u89E3\u96C7\u7684\u7406\u7531\u7ADF\u662F\u56E0\u4E3A\u5B66\u751F\u6295\u8BC9\u4ED6\u7684\u8BFE\u7A0B\u96BE\u5EA6\u8FC7\u9AD8\u3002\u636E\u62A5\u9053\uFF0C\u4ED6\u6559\u6388\u7684350\u540D\u5B66\u751F\u4E2D\u670982\u4EBA\u8054\u540D\u7B7E\u7F72\u4E86\u4E00\u4EFD\u9488\u5BF9\u4ED6\u7684\u8BF7\u613F\u4E66\uFF0C\u6297\u8BAE\u743C\u65AF\u7684\u8BFE\u7A0B\u592A\u96BE\u3002\u8FD9\u4E9B\u5B66\u751F\u5C06\u4ED6\u4EEC\u7684\u8003\u8BD5\u6210\u7EE9\u5DEE\u5F52\u548E\u4E8E\u743C\u65AF\u3002\u4ED6\u4EEC\u5728\u8BF7\u613F\u4E66\u4E2D\u5199\u9053\uFF1A\u201C\u6211\u4EEC\u6566\u4FC3\u4F60\u4EEC\u8BA4\u8BC6\u5230\uFF0C\u4E00\u4E2A\u9000\u8BFE\u7387\u5982\u6B64\u4E4B\u9AD8\u3001\u6210\u7EE9\u5982\u6B64\u4E4B\u4F4E\u7684\u8BFE\u7A0B\uFF0C\u6CA1\u6709\u628A\u5B66\u751F\u7684\u5B66\u4E60\u548C\u5E78\u798F\u653E\u5728\u9996\u4F4D\uFF0C\u4E5F\u7ED9\u5316\u5B66\u7CFB\u548C\u6574\u4E2A\u5B66\u9662\u5E26\u6765\u4E86\u4E0D\u597D\u7684\u5F71\u54CD\u3002\u201D</p><p>\u6709\u7F51\u53CB\u8BC4\u8BBA\uFF1A\u201C\u5982\u679C\u8FD9\u79CD\u7406\u7531\u80FD\u591F\u6210\u4E3A\u89E3\u8058\u6559\u6388\u7684\u7406\u7531\uFF0C\u957F\u6B64\u4EE5\u5F80\uFF0C\u7F8E\u56FD\u8BFA\u5956\u7EA7\u5316\u5B66\u6C34\u5E73\u6050\u6015\u4E5F\u8981\u540E\u7EE7\u4E4F\u4EBA\u4E86\u3002\u201D\u6211\u4EEC\u5F53\u7136\u4E0D\u5FC5\u66FF\u7F8E\u56FD\u7684\u5316\u5B66\u6C34\u5E73\u64CD\u5FC3\uFF0C\u4F46\u662F\uFF0C\u6B64\u4E8B\u53CD\u6620\u51FA\u5927\u5B66\u7684\u5E08\u751F\u5173\u7CFB\uFF0C\u6709\u8D85\u8D8A\u56FD\u522B\u7684\u666E\u904D\u6027\u610F\u4E49\uFF0C\u503C\u5F97\u8BA8\u8BBA\u3002</p><p>\u7535\u8111\u6DF1\u5EA6\u6E05\u7406\uFF0C\u5E72\u51C0\u65E0\u5F39\u7A97-\u5FAE\u8F6F\u7535\u8111\u7BA1\u5BB6 \u5E7F\u544A Microsoft \u7535\u8111\u6DF1\u5EA6\u6E05\u7406\uFF0C\u5E72\u51C0\u65E0\u5F39\u7A97-\u5FAE\u8F6F\u7535\u8111\u7BA1\u5BB6 \u4E00\u822C\u6765\u8BF4\uFF0C\u957F\u671F\u4EE5\u6765\uFF0C\u4F20\u7EDF\u6559\u80B2\u6A21\u5F0F\u4E2D\uFF0C\u5B66\u6821\u4E0E\u5B66\u751F\u3001\u8001\u5E08\u4E0E\u5B66\u751F\u4E4B\u95F4\u7684\u5173\u7CFB\uFF0C\u5B66\u751F\u5904\u4E8E\u76F8\u5BF9\u5F31\u52BF\u7684\u4E00\u65B9\uFF0C\u8FD9\u5BF9\u5B66\u751F\u662F\u4E0D\u516C\u5E73\u7684\u3002\u56E0\u6B64\uFF0C\u73B0\u4EE3\u6559\u80B2\u7406\u5FF5\u5F3A\u8C03\u5EFA\u7ACB\u201C\u4EE5\u5B66\u751F\u4E3A\u4E2D\u5FC3\u7684\u6559\u80B2\u201D\uFF0C\u5F3A\u8C03\u8981\u5C0A\u91CD\u5B66\u751F\u5728\u6559\u5B66\u4E2D\u7684\u4E3B\u4F53\u5730\u4F4D\uFF0C\u8425\u9020\u66F4\u52A0\u5305\u5BB9\u3001\u6C11\u4E3B\u7684\u5B66\u4E60\u73AF\u5883\u3002\u5177\u4F53\u5230\u5404\u7C7B\u5B66\u6821\u6765\u8BF4\uFF0C\u5728\u65E5\u5E38\u6559\u5B66\u4E2D\u503E\u542C\u5B66\u751F\u7684\u547C\u58F0\uFF0C\u91CD\u89C6\u5B66\u751F\u7684\u8BC9\u6C42\uFF0C\u8FD9\u65B9\u9762\u5DE5\u4F5C\u5E94\u8BE5\u52A0\u5F3A\u3002\u4F46\u662F\u8FD9\u4E9B\u5E74\u6765\uFF0C\u5728\u4E00\u4E9B\u5730\u65B9\u3001\u4E00\u4E9B\u9AD8\u6821\u7684\u5E08\u751F\u5173\u7CFB\u4E2D\uFF0C\u51FA\u73B0\u4E86\u4E00\u4E9B\u503C\u5F97\u91CD\u89C6\u7684\u82D7\u5934\u3002\u6BD4\u5982\u5F88\u591A\u5B66\u6821\u5F00\u5C55\u81EA\u4E3B\u9009\u8BFE\u5E76\u5EFA\u7ACB\u5B66\u751F\u8BC4\u6559\u4F53\u7CFB\uFF0C\u4E0E\u4E4B\u76F8\u5E94\uFF0C\u90E8\u5206\u5B66\u751F\u4E2D\u51FA\u73B0\u4E86\u7EA7\u7EA7\u76F8\u4F20\u7684\u6240\u8C13\u201C\u9009\u8BFE\u5B9D\u5178\u201D\uFF0C\u54EA\u4E9B\u8001\u5E08\u4E0A\u8BFE\u8981\u6C42\u9AD8\u3001\u7ED9\u5206\u4E25\uFF0C\u54EA\u4E9B\u8001\u5E08\u8981\u6C42\u5BBD\u677E\u3001\u987A\u624B\u9001\u5206\uFF0C\u90FD\u4F1A\u5199\u5F97\u660E\u660E\u767D\u767D\u3002</p><p>\u6240\u8C13\u201C\u4E8B\u591A\u5206\u4F4E\u201D\u7684\u8001\u5E08\u7684\u8BFE\u662F\u5FC5\u987B\u8EB2\u5F00\u7684\u9009\u8BFE\u201C\u5927\u5751\u201D\uFF0C\u800C\u76F8\u53CD\u201C\u4E8B\u5C11\u5206\u9AD8\u201D\u7684\u8001\u5E08\uFF0C\u5F80\u5F80\u8D8B\u4E4B\u82E5\u9E5C\u3002\u5728\u8FD9\u6837\u7684\u6559\u5B66\u6C1B\u56F4\u4E2D\uFF0C\u4E00\u4E9B\u8001\u5E08\u6478\u51C6\u4E86\u5B66\u751F\u7684\u559C\u597D\uFF0C\u4E0A\u8BFE\u523B\u610F\u8FCE\u5408\u5B66\u751F\uFF0C\u8BA9\u5B66\u751F\u6EE1\u610F\uFF0C\u6709\u4E9B\u8001\u5E08\u5219\u662F\u8003\u524D\u660E\u786E\u627F\u8BFA\u8BA9\u5927\u5BB6\u90FD\u80FD\u901A\u8FC7\uFF0C\u6709\u4E9B\u8FD8\u7279\u610F\u62D4\u9AD8\u5206\u6570\uFF0C\u76EE\u7684\u4E00\u662F\u5438\u5F15\u5B66\u751F\u9009\u81EA\u5DF1\u7684\u8BFE\uFF0C\u4E8C\u662F\u8BA9\u5B66\u751F\u5728\u8BC4\u6559\u4E2D\u7ED9\u81EA\u5DF1\u6253\u9AD8\u5206\u3002\u800C\u4E00\u4E9B\u5B66\u6821\u5728\u6559\u5B66\u6548\u679C\u7684\u8BC4\u4EF7\u4E2D\uFF0C\u4E5F\u8FC7\u5206\u5F3A\u8C03\u5B66\u751F\u6253\u5206\uFF0C\u751A\u81F3\u628A\u4E00\u5802\u8BFE\u8001\u5E08\u8BB2\u8BFE\u5F15\u8D77\u5B66\u751F\u53D1\u7B11\u7684\u6B21\u6570\u4F5C\u4E3A\u8BC4\u4EF7\u8001\u5E08\u6559\u5B66\u6548\u679C\u7684\u6307\u6807\uFF0C\u4E00\u4E9B\u5B66\u6821\u8FD8\u63D0\u51FA\u201C\u4EE5\u5B66\u751F\u4E3A\u4E0A\u5E1D\u201D\u7B49\u53E3\u53F7\u3002\u5E94\u8BE5\u8BF4\uFF0C\u8FD9\u7C7B\u73B0\u8C61\u90FD\u662F\u4E0D\u5065\u5EB7\u7684\u3002</p><p>\u201C\u6D88\u8D39\u8005\u5C31\u662F\u4E0A\u5E1D\u201D\u201C\u987E\u5BA2\u90FD\u662F\u5BF9\u7684\u201D\u8FD9\u6837\u7684\u7406\u5FF5\uFF0C\u5728\u5546\u4E1A\u8425\u9500\u4E2D\u53EF\u4EE5\u5949\u4E3A\u572D\u81EC\uFF0C\u4F46\u5982\u679C\u4E0D\u52A0\u5206\u522B\u5730\u5F15\u5165\u5B66\u6821\u6559\u5B66\u7BA1\u7406\u4E2D\uFF0C\u53EA\u53EF\u80FD\u4F1A\u4FC3\u4F7F\u6559\u80B2\u7578\u53D8\u3002\u6211\u4EEC\u5E94\u8BE5\u770B\u5230\uFF0C\u201C\u4EE5\u5B66\u751F\u4E3A\u4E2D\u5FC3\u201D\u7684\u6559\u5B66\u7406\u5FF5\uFF0C\u5F3A\u8C03\u7684\u662F\u8FD0\u7528\u591A\u79CD\u65B9\u5F0F\u5145\u5206\u8C03\u52A8\u5B66\u751F\u5B66\u4E60\u7684\u79EF\u6781\u6027\u4E0E\u4E3B\u52A8\u6027\uFF0C\u5F15\u5BFC\u5B66\u751F\u901A\u8FC7\u81EA\u4E3B\u5B66\u4E60\u57F9\u517B\u89E3\u51B3\u95EE\u9898\u7684\u80FD\u529B\u3002\u5728\u8FD9\u4E2A\u8FC7\u7A0B\u4E2D\uFF0C\u8981\u575A\u6301\u5E08\u751F\u5E73\u7B49\u539F\u5219\uFF0C\u8001\u5E08\u8981\u5145\u5206\u5C0A\u91CD\u5B66\u751F\u7684\u4EBA\u683C\uFF0C\u5E76\u5C3D\u53EF\u80FD\u6839\u636E\u6BCF\u4E2A\u5B66\u751F\u7684\u4E0D\u540C\u7279\u8D28\u8FDB\u884C\u4E2A\u6027\u5316\u57F9\u517B\u3002\u4F46\u662F\uFF0C\u5173\u5FC3\u5B66\u751F\u3001\u7231\u62A4\u5B66\u751F\uFF0C\u7EDD\u4E0D\u610F\u5473\u7740\u8BA8\u597D\u5B66\u751F\uFF0C\u4E00\u5473\u8FCE\u5408\u5B66\u751F\uFF0C\u628A\u201C\u5B66\u751F\u6EE1\u610F\u201D\u4F5C\u4E3A\u8BC4\u4EF7\u6559\u5B66\u6548\u679C\u7684\u552F\u4E00\u6807\u51C6\u3002</p><p>\u4E8B\u5B9E\u4E0A\uFF0C\u771F\u6B63\u7684\u6559\u80B2\u4E2D\uFF0C\u4E25\u683C\u8981\u6C42\u662F\u5BF9\u5B66\u751F\u6700\u9AD8\u7684\u5C0A\u91CD\uFF0C\u662F\u771F\u6B63\u4E3A\u5B66\u751F\u8D1F\u8D23\u4EFB\u3002\u6B63\u5982\u6709\u89C2\u70B9\u6307\u51FA\uFF1A\u201C\u4E00\u5473\u7ED9\u4E88\u5B66\u751F\u5373\u65F6\u6EE1\u8DB3\u3001\u7167\u987E\u4ED6\u4EEC\u5F53\u4E0B\u7684\u611F\u53D7\uFF0C\u4ECE\u53E6\u4E00\u4E2A\u89D2\u5EA6\u770B\uFF0C\u8FD9\u5176\u5B9E\u662F\u5728\u5426\u8BA4\u5B66\u751F\u7684\u6210\u957F\u6F5C\u529B\u3002\u201D</p><p>\u5FB7\u56FD\u793E\u4F1A\u5B66\u5BB6\u9A6C\u514B\u65AF\xB7\u97E6\u4F2F\u5728\u4ED6\u300A\u4EE5\u5B66\u672F\u4E3A\u4E1A\u300B\u7684\u6F14\u8BB2\u4E2D\u8BF4\uFF1A\u201C\u4E8B\u5B9E\u4E0A\uFF0C\u5B66\u751F\u662F\u5426\u6D8C\u5411\u67D0\u4F4D\u8001\u5E08\u7684\u8BFE\u5802\uFF0C\u591A\u534A\u53D6\u51B3\u4E8E\u4E00\u4E9B\u7EAF\u7CB9\u7684\u5916\u7F18\u6027\u56E0\u7D20\uFF0C\u8BF8\u5982\u6027\u60C5\u3001\u751A\u81F3\u58F0\u97F3\u7684\u6291\u626C\u987F\u632B\u2026\u2026\u6211\u5BF9\u90A3\u4E9B\u95E8\u5EAD\u82E5\u5E02\u7684\u8BFE\u7A0B\u6DF1\u611F\u6000\u7591\u3002\u201D100\u591A\u5E74\u540E\u7684\u4ECA\u5929\uFF0C\u6211\u4EEC\u770B\u201C\u7EBD\u7EA6\u5927\u5B66\u5B66\u751F\u6295\u8BC9\u8BFE\u7A0B\u592A\u96BE\uFF0C84\u5C81\u77E5\u540D\u6559\u6388\u88AB\u89E3\u96C7\u201D\u7684\u65B0\u95FB\uFF0C\u5145\u6EE1\u4E86\u611F\u6168\u3002\u770B\u6765\uFF0C\u5982\u4F55\u6B63\u786E\u5B9A\u4F4D\u6559\u5B66\u7684\u5E08\u751F\u5173\u7CFB\uFF0C\u4EC0\u4E48\u662F\u597D\u7684\u6559\u80B2\uFF0C\u662F\u503C\u5F97\u63A2\u8BA8\u7684\u6C38\u6052\u8BDD\u9898\u3002</p><p>\u7EA2\u661F\u65B0\u95FB\u7279\u7EA6\u8BC4\u8BBA\u5458 \u738B\u5929\u5B9A\uFF08\u4E2D\u56FD\u6D77\u6D0B\u5927\u5B66\u6587\u5B66\u4E0E\u65B0\u95FB\u4F20\u64AD\u5B66\u9662\u6559\u6388\uFF09</p><p>df</p><p>f</p>',12),_=[n];function s(o,i,c,d,g,f){return a(),e("div",null,_)}const l=t(r,[["render",s]]);export{S as __pageData,l as default};
